import React, { useState } from 'react';
import image1 from './assets/Cardimage/alensoly.png';
import image2 from './assets/Cardimage/formal.png';
import image3 from './assets/Cardimage/suit.png';
import './dataa.css';

function Data() {
  const [data, setData] = useState([
    { name: 'Alensolly T-shirt', src: image1 },
    { name: 'Formal shirt', src: image2 },
    { name: 'Formal Suit', src: image3 },
  ]);

  return (
    <div className='hi'>
      {data.map((obj) => (
        <div key={obj.name}>
          <img src={obj.src} alt="" />
          <h2>{obj.name}</h2>
        </div>
      ))}
    </div>
  );
}

export default Data;
